const LeaderboardChallengeObj = (props) => {
    return (<div>
        <div id = "medalImage">
            {
                props.iftop3 ?<img></img>:<p></p>
            }
        </div>
        <div>
            <img></img>
            <p>Display Name</p>
            <ProgressBar>10</ProgressBar>
            <img></img>
            <p>2</p>
        </div>
    </div>)
}

const LeaderboardChallenge = (props) => {
    function convertChallengeObj(people){
        let real_list = [];
        for(let i = 0; i < people.length; i++){
            real_list.push({"num":i, person: people[i]});
        }
        return real_list.map((person)=>LeaderboardChallengeObj(person))
    }
    const [challengeObj] = useState(convertChallengeObj(props.progress));
    return (
        <div>
            <h2>Progress Leaderboard</h2>
            {challengeObj}
        </div>
    );
}

export default LeaderboardChallenge
